INSERT INTO `v1_0ef841ecfd569ae7bdb9e024125a3f9b272e0c051ac1dd34438a9c87c6fdb162` VALUES (111011, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 0, 1110501, 0, "", 1110501046, 11, 4, 1, 1);
INSERT INTO `v1_0ef841ecfd569ae7bdb9e024125a3f9b272e0c051ac1dd34438a9c87c6fdb162` VALUES (0, "", "", 1110501, "", "", 1110501047, 91, "", "", "");
