INSERT INTO `v1_0ef841ecfd569ae7bdb9e024125a3f9b272e0c051ac1dd34438a9c87c6fdb162` VALUES (111011, "是非もなし。\n端的に言えば、先輩ちょっと感激した。\n今宵は飲めや食えやの大騒ぎだ。\n朝まで踊り明かすぜ同志、ヒャッハー！", 0, 1110501, 0, "", 1110501052, 11, 5, 1, 1);
